function main(page: IPage, portlet: IEChartsPortlet) {
	let opt = portlet.getChartOptions();
	let isZooming = false;
	let zoomParams: any = null;
	let start_date_portlet = page.getPortletsByTitle("开始时间")[0];
	let end_date_portlet = page.getPortletsByTitle("结束时间")[0];

	console.log(opt);
	opt.dataZoom[0] = {
		type: "slider",
		startValue: '2020-05-07',
		endValue: '2021-08-22',
		start: 20,
		end: 100
	}
	let chartInstance = portlet.getChartInstance();
	// 监听 dataZoom 事件
	chartInstance.on('dataZoom', function(params: any) {
		isZooming = true;
		zoomParams = params;
		// console.log(new Date().toLocaleString());
		console.log(params);
		console.log(opt);


	})

	// 监听 mouseup 事件
	chartInstance.getZr().on('mouseup', function() {
		if (isZooming) {
			isZooming = false;

			if (zoomParams) {
				let startIndex = Math.round(zoomParams.start * (opt.series[0].data.length - 1) / 100);
				let endIndex = Math.round(zoomParams.end * (opt.series[0].data.length - 1) / 100);

				// 获取对应的 startValue 和 endValue
				let startValue = opt.series[0].data[startIndex].displayValue[0];
				let endValue = opt.series[0].data[endIndex].displayValue[0];
				let startValue_price = opt.series[0].data[startIndex].displayValue[1];
				let endValue_price = opt.series[0].data[endIndex].displayValue[1];
				start_date_portlet.setValue([startValue]);
				end_date_portlet.setValue([endValue]);



				page.getPortletById("df3a07f4d914e1339eb2448c5e8eabee").setTitle("startValue:\t" + startValue +
					"\tstartValue_price：" + startValue_price);
				page.getPortletById("29771f8b79b893d1ee9a5ec11815b83e").setTitle("endValue:\t" + endValue +
					"\tendValue_price：" + endValue_price);
				console.log("startValue:\t" + startValue + "\tstartValue_price：" + startValue_price);
				console.log("endValue:\t" + endValue + "\tendValue_price：" + endValue_price);
			}
		}
	});
	debugger
}